</code></pre><ol start="4"><li>构建生产版本</li></ol><pre><code class="language-shell">npm run build
</code></pre><h2>常见问题</h2><p>暂无</p><h2>获得帮助</h2><blockquote><p>因为是开源项目 全靠爱发电 所以支持有限 更新节奏不固定</p><p>注意：非 BUG 或计划外的需求，有偿处理；至于金额，根据问题难易程度，你觉得帮助了多少，看着给吧（维护这些项目已经耗费了大量精力，还要免费花时间解答问题就说不过去了吧…所以白嫖的一律不通过。）</p></blockquote><ul><li>issues: <a href="https://github.com/viarotel-org/escrcpy/issues">反馈问题</a></li><li>email: <a href="mailto:viarotel@qq.com">viarotel@qq.com</a></li><li>weixin: viarotel</li><li>qq: 523469508</li></ul><h2>致谢</h2><p>该项目的诞生离不开以下开源项目</p><ul><li><a href="https://vitejs.dev">vite</a></li><li><a href="https://vuejs.org">vue</a></li><li><a href="https://github.com/sindresorhus/github-markdown-css">github-markdown-css</a></li><li><a href="https://github.com/richardtallent/vite-plugin-singlefile">vite-plugin-singlefile</a></li><li><a href="https://github.com/unplugin/unplugin-vue-markdown">unplugin-vue-markdown</a></li><li><a href="https://github.com/fraserxu/electron-pdf">electron-pdf</a></li><li><a href="https://unocss.dev">unocss</a></li></ul><h2>支持项目</h2><blockquote><p>如果该项目帮到你的话，可以请我喝杯咖啡，让我更有精神完善该项目 😛</p></blockquote><div style="display:flex;"><img src="`+yf+'" alt="viarotel-wepay" style="width:30%;"><img src="'+mf+'" alt="viarotel-alipay" style="width:30%;"></div>',24),If=[Tf],Ef={__name:"README-CN",setup(A,{expose:o}){return o({frontmatter:{}}),(i,F)=>(dK(),VK("div",Wf,If))}},Mf={class:"markdown-body"},Zf={__name:"App",setup(A,{expose:o}){return o({frontmatter:{}}),(i,F)=>(dK(),VK("div",Mf,[CA(Sf),CA(zi(Ef))]))}},Yf=bf(Zf);Yf.mount("#app");
